import { useNavigate } from "react-router-dom";
import { library } from '@fortawesome/fontawesome-svg-core'
import { fas } from '@fortawesome/free-solid-svg-icons'
import { far } from '@fortawesome/free-regular-svg-icons'
import { fab } from '@fortawesome/free-brands-svg-icons'
library.add(fas, far, fab)

const Home = ()=>{

    const navigate = useNavigate();
    
    const goToAvInt=()=>{
        const path=`/interns`
        navigate(path)
    }

    const goToAddInt=()=>{
        const path=`/new-intern`
        navigate(path)
    }

    return (
        <div className="homePage">
            <div className="dialogBox">
                <header><h1>Choose your role</h1></header>
                <div className="option">
                    <form >
                        <button onClick={goToAvInt}><i className="fa-solid fa-graduation-cap"></i>Student</button>
                        <button onClick={goToAddInt}><i className="fa-solid fa-briefcase"></i>Employer</button>
                    </form>
                </div>
            </div>
        </div>
    );
}

export default Home;
